import React, { Component } from 'react';
import {Grid, Cell} from 'react-mdl';  

class Home extends Component {
    render() {
        return (
            <div style={{width: '100%', margin: 'auto'}}>
                <Grid className="home-grid">
                    <Cell col={12}></Cell>
                    <img src="./images/2018-07-12.gif"></img>
                </Grid>
                <h1>Home</h1>
            </div>
        )
    }

}

export default Home;
